package leetcodeTest_test

import (
	"AlgorithmWithGo/leetcode"
	"fmt"
)

func ExampleLongestPalindromicSubstring() {
	fmt.Println(leetcode.LongestPalindrome("babad"))
	fmt.Println(leetcode.LongestPalindrome("ababababa"))
	fmt.Println(leetcode.LongestPalindrome("abcdasdfghjkldcba"))
	fmt.Println(leetcode.LongestPalindrome(""))
	// output:
	// bab
	// ababababa
	//
}
